import React, { useState } from 'react';
import Api from '../Api';
import '../assets/header.css';

const Navbar = () => {
    const [formData, setFormData] = useState([
        'token'
    ]);

    return(
        <>
        <div class="header">
            <div>
                <a href="#">Papan</a>
            </div>
        </div>
        </>
    );
}

export default Navbar;
